import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Header from './Welbexcomp/header';
import Body from './Welbexcomp/body';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <Header/>
    <Body/>
  </React.StrictMode>
);
